[mcu]
serial: /dev/serial/by-id/usb-Klipper_lpc1768_0E100111018139AF8B50075CC12000F5-if00

[stepper_x]
step_pin: P2.2
dir_pin: P2.6
enable_pin: !P2.1
step_distance: 0.0125
endstop_pin: ^P1.29
position_endstop: 250
position_min: 0
position_max: 250
homing_speed: 70
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: P1.17
tx_pin: P4.29
microsteps: 16
run_current: 0.8
hold_current: 0.3
interpolate: True
stealthchop_threshold: 0

[stepper_y]
step_pin: P0.19
dir_pin: P0.20
enable_pin: !P2.8
step_distance: 0.0125
endstop_pin: ^P1.27
position_endstop: 247
position_min: 0
position_max: 250
homing_speed: 70
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: P1.15
tx_pin: P1.16
microsteps: 16
run_current: 0.8
hold_current: 0.3
interpolate: true
stealthchop_threshold: 0

[stepper_z]
step_pin: P0.22
dir_pin: !P2.11
enable_pin: !P0.21
step_distance: .0125
endstop_pin: probe:z_virtual_endstop
#position_endstop: 0.0
position_max: 250
homing_speed: 40
second_homing_speed: 40
position_min: -3.0

[tmc2209 stepper_z]
uart_pin: P1.10
tx_pin: P1.14
microsteps: 16
run_current: 0.8
hold_current: 0.3
interpolate: True
stealthchop_threshold: 0

[include configs/homing_and_z_offset.cfg]

[bed_mesh]
speed: 150
horizontal_move_z: 10
#mesh_min: 20,35
#mesh_max: 235,210
#probe_count: 7,6
#mesh_min: 25,35.0
#mesh_max: 225.0,220
#probe_count: 6,6
mesh_min: 15,25
mesh_max: 230,235
probe_count: 11,11
#mesh_min: 6,25
#mesh_max: 244,215
#probe_count: 120,96
algorithm: bicubic
fade_start: 1
fade_end: 10
fade_target: 0

[probe]
pin: P1.25
x_offset: -1.75
y_offset: 25.0
z_offset: 5.85
speed: 40
samples: 1
#   The number of times to probe each point. The probed z-values will
#   be averaged. The default is to probe 1 time.
sample_retract_dist: 5
#   The distance (in mm) to lift the toolhead between each sample (if
#   sampling more than once). The default is 2mm.
lift_speed: 100
#   Speed (in mm/s) of the Z axis when lifting the probe between
#   samples. The default is to use the same value as the 'speed'
#   parameter.
samples_result: average
#   The calculation method when sampling more than once - either
#   "median" or "average". The default is average.
samples_tolerance: 0.013
#   The maximum Z distance (in mm) that a sample may differ from other
#   samples. If this tolerance is exceeded then either an error is
#   reported or the attempt is restarted (see
#   samples_tolerance_retries). The default is 0.100mm.
samples_tolerance_retries: 5
#   The number of times to retry if a sample is found that exceeds
#   samples_tolerance. On a retry, all current samples are discarded
#   and the probe attempt is restarted. If a valid set of samples are
#   not obtained in the given number of retries then an error is
#   reported. The default is zero which causes an error to be reported
#   on the first sample that exceeds samples_tolerance.

[extruder]
#max_extrude_only_distance: 100.0
max_extrude_cross_section: 50
max_extrude_only_distance: 700.00
step_pin: P2.13
dir_pin: P0.11
enable_pin: !P2.12
step_distance: 0.00242
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: P2.7
pressure_advance: 0.1
pressure_advance_smooth_time: 0.040
#sensor_type: ATC Semitec 104GT-2
sensor_type: EPCOS 100K B57560G104F
#sensor_type: NTC 100K beta 3950
sensor_pin: P0.24
#control = pid
#pid_kp = 18.973
#pid_ki = 0.771
#pid_kd = 116.683
min_temp: 0
max_temp: 270

[tmc2209 extruder]
uart_pin: P1.8
tx_pin: P1.9
microsteps: 16
run_current: 0.8
hold_current: 0.4
interpolate: True

[firmware_retraction]
retract_length: 0.75
retract_speed: 30
unretract_extra_length: 0
unretract_speed: 25

[temperature_sensor chamber_temp_at_xchain]
sensor_type: ATC Semitec 104GT-2
sensor_pin: P0.25
min_temp: 0
max_temp: 90

[controller_fan my_controller_fan]
pin: P1.24
max_power: 1.00
kick_start_time: 0.200
heater: heater_bed
fan_speed: 0.5

[heater_bed]
heater_pin: P2.5
sensor_type: ATC Semitec 104GT-2
#sensor_type: EPCOS 100K B57560G104F
sensor_pin: P0.23
#control = pid
#pid_kp = 60.695
#pid_ki = 1.073
#pid_kd = 858.069
min_temp: 0
max_temp: 130

[verify_heater heater_bed]
max_error: 180
#   The maximum "cumulative temperature error" before raising an
#   error. Smaller values result in stricter checking and larger
#   values allow for more time before an error is reported.
#   Specifically, the temperature is inspected once a second and if it
#   is close to the target temperature then an internal "error
#   counter" is reset; otherwise, if the temperature is below the
#   target range then the counter is increased by the amount the
#   reported temperature differs from that range. Should the counter
#   exceed this "max_error" then an error is raised. The default is
#   120.
check_gain_time: 120
#   This controls heater verification during initial heating. Smaller
#   values result in stricter checking and larger values allow for
#   more time before an error is reported. Specifically, during
#   initial heating, as long as the heater increases in temperature
#   within this time frame (specified in seconds) then the internal
#   "error counter" is reset. The default is 20 seconds for extruders
#   and 60 seconds for heater_bed.
hysteresis: 15
#   The maximum temperature difference (in Celsius) to a target
#   temperature that is considered in range of the target. This
#   controls the max_error range check. It is rare to customize this
#   value. The default is 5.
heating_gain: 2
#   The minimum temperature (in Celsius) that the heater must increase
#   by during the check_gain_time check. It is rare to customize this
#   value. The default is 2.

[fan]
pin: P2.3

# thermally controlled hotend fan
[heater_fan my_nozzle_fan]
pin: P2.4
max_power: 1.0
kick_start_time: 0.100
heater: extruder
heater_temp: 50.0
fan_speed: 1.0

[printer]
kinematics: corexz
max_velocity: 300
max_accel: 10000
max_accel_to_decel: 10000
max_z_velocity: 50
max_z_accel: 1000
square_corner_velocity: 5
		
